import React from 'react';
import { Nav, Container, Navbar } from 'react-bootstrap';

function Topbar() {
  return ( 
    <Navbar bg="dark" variant="dark" expand="lg">
  <Container className="p-4">
    <Navbar.Brand href="#">SHREYA JHA</Navbar.Brand>
  </Container>
</Navbar>
   );
}

export default Topbar;
